export default function AccordionProfile() {
  const [isOpen, setIsOpen] = useState(true);


  const handleAccordionChange = () => {
    setIsOpen(!isOpen);
    console.log(isOpen)
  };

  return (
    <Accordion
      motionProps={{
        variants: {
          enter: {
            y: 0,
            opacity: 1,
            height: 'auto',
            transition: {
              height: {
                type: 'spring',
                stiffness: 500,
                damping: 30,
                duration: 1,
              },
              opacity: {
                easings: 'ease',
                duration: 1,
              },
            },
          },
          exit: {
            y: -10,
            opacity: 0,
            height: 0,
            transition: {
              height: {
                easings: 'ease',
                duration: 0.25,
              },
              opacity: {
                easings: 'ease',
                duration: 0.3,
              },
            },
          },
        },
      }}
    >
      <AccordionItem
        key="1"
        aria-label="Accordion 1"
        title={isOpen ? 'Mask' : 'Open'}
        onChange={handleAccordionChange}
        className="pl-5 pr-5 bg-[#F8F7F1] dark:bg-[#1B1B1B] rounded-xl"
      >
        {accordionData.map((item) => (
          <button
            key={item.id}
            onClick={item.event}
            className="flex w-full text-left border-t-[3px] border-white dark:border-[#292929] font-semibold py-2"
          >
            <item.icon />
            <div className="flex justify-between w-full pl-3">
              {item.title === 'Logout' ? <span className="text-md text-[red]">{item.title}</span>
                : <span className="text-md">{item.title}</span>}
              {item.title === 'Messages' && (
                <div className='text-sm bg-[#717171] w-5 h-5 flex items-center justify-center mt-1 text-white rounded-full'>
                  <span>2</span>
                </div>)}
            </div>
          </button>
        ))}
      </AccordionItem>
    </Accordion>
  );
}

